# This Python script is a typical adaptive reduced order modeling (ROM) of a smooth wheel soil interaction test (SWI) over Fillite regolith 
# at a  loose state (n=0.570).
# NOTE: ALL EXTERNAL FILES (DEM GEOMETRY), AND OUTPUT FOLDERES ARE PROVIDED. THE CORRECT ADDRESSES
# MUST BE PROVIDED BY THE USER FROM THEIR OWN LOCAL MACHINES. 
# This simulation has the following characteristics:
# 1- The granular assembly is  made of clump grains per the Outward's grain generation scheme.
# 2- DEM assembly size is 5.0mm(X-direction)*6.0mm(Y-direction)x20mm(Z-Direction). The simulation is considered as a half-width model (X direction)
# where the wheel penetrates and rolls  along thefront boundary (-X)  of the Fillite assembly.
# 3- Wall boundaries has been generated using YADE built-in geometry generation functions for boxes and therefore is not deformable but the wheel consists of 
# 2459 overlapping spheres with the radius of 0.190mm and therefore is deformable. 
# 4- Wheel movement consists of two stages: (a) Penetration of the wheel to 1.0mm from the surface of the granular assembly (-Y direction), and (b) Rolling 
# thorough the regolith in +Z direction.
# 5- The penetration and rolling/movement  proceses have been modeled  using the YADE built-in TranslationEngine and CombinedKinematicEngine respectively. 
# 6- A simple FrictMat  material constituitive model has been used. 
#**********************************************************************************************************
#**********************************************************************************************************
